<script>
$("#btnSignin").click(function() {
    debugger;
    $('#btnSignin').html('Please Wait...');
    $("#btnSignin").attr("disabled", true);

    var form = $('#loginForm')[0];
    var data = new FormData(form);
    $.ajaxSetup({
        headers: {
            'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
        }
    });
    $.ajax({
        url: "{{url('teacherLogin-check')}}",
        enctype: 'multipart/form-data',
        type: "POST",
        data: data,
        processData: false,
        contentType: false,
        cache: false,
        success: function(response) {

            debugger;

            $('#btnSignin').html('Sign in');
            $("#btnSignin").attr("disabled", false);
            var email = $('#email').val();

            if (response.status == 200) {

                toastr['success'](
                    'Login succesfully.',
                    'Success!', {
                        closeButton: true,
                        tapToDismiss: false,
                        rtl: false
                    });

                window.location.replace("{{ url('teacherDashboard') }}");

            } else {
                toastr['error'](
                    response.message,
                    'Error!', {
                        closeButton: true,
                        tapToDismiss: false,
                        rtl: false
                    });
            }

        },
        error: function(jqXHR, textStatus, errorThrown) {

            debugger;

            $('#btnSignin').html('Sign in');
            $("#btnSignin").attr("disabled", false);

            toastr['error'](
                'Failed to Login. Please try again.',
                'Error!', {
                    closeButton: true,
                    tapToDismiss: false,
                    rtl: false
                });
       
        }
    });
});


function render() {
    document.querySelector("#recaptcha-container").innerHTML="";
    window.recaptchaVerifier = new firebase.auth.RecaptchaVerifier('recaptcha-container', {
        'callback': (response) => {
            console.log(response);
            // reCAPTCHA solved, allow signInWithPhoneNumber.
            // ...
            $("#btnSignin").removeAttr('disabled');
        },
        'expired-callback': () => {
            console.log("expired-callback");
            $("#btnSignin").attr("disabled", true);

            toastr['error'](
                    'reCAPTCHA Expired. Try Again.',
                    'Error!', {
                        closeButton: true,
                        tapToDismiss: false,
                        rtl: false
                    });

        }
    });
    recaptchaVerifier.render();

}

window.onload = function () {
    render();
};
</script>


